            <div className="col-md-6 offset-md-3">
              <input
                type="text"
                onChange={eventoTeste}
                name="model"
                className="form-control"
                placeholder="Model"
              />
            </div>
            <div className="col-md-6 offset-md-3">
              <input
                type="text"
                onChange={eventoTeste}
