                name="purchasePrice"
                className="form-control"
                placeholder="Purchase price"
              />
            </div>
            <div className=" col-md-6 offset-md-3">
              <input
                type="text"
                onChange={eventoTeste}
                name="saleValue"
                className="form-control"
                placeholder="Sale value"
              />
            </div>
            <div className="col-md-6 offset-md-3">
              <input
                type="text"
                onChange={eventoTeste}
                name="purchaseDate"
                className="form-control"
                placeholder="Purchate date"
              />
            </div>
            <div className="col-md-6 offset-md-3">
              <input
                type="text"
                onChange={eventoTeste}
                name="arrivalDate"
                className="form-control"
                placeholder="Arrival date"
              />
            </div>
            <div className="col-md-6 offset-md-3">
              <input
                type="text"
                onChange={eventoTeste}
                name="productCategory"
                className="form-control"
                placeholder="Category"
              />
            </div>

            <div className="botao">
              {botao ? (
                <input
                  type="button"
                  onClick={cadastrar}
                  className="btn btn-success"
                  value="Cadastrar"
                />
              ) : (
                <div>
                  <input
                    type="button"
                    className="btn btn-secondary"
                    value="Início"
                  />
                  <input
                    type="button"
                    className="btn btn-dark"
                    value="Pesquisar"
                  />
                  <input
                    type="button"
                    className="btn btn-primary"
                    value="Listar"
                  />
                </div>
              )}
            </div>
          </div>
        </div>
        <button type="button" onClick={(e) => this.handleUpload(e)}>
          enviar
        </button>
      </form>
    </div>
  );
}
}

